import React, { Component } from "react";
import NavBar from "./components/navbar";
import Counters from "./components/counters";
import "./App.css";

/* we wrap the html elements within React Fragment to tell 
React that there are more than one elemenents that need to be wrapped.
It is also common to wrap it within <div> */

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <main className="container">
          <Counters />
        </main>
      </React.Fragment>
    );
  }
}

export default App;
